import { useCallback } from "react";
// import { Button } from "@mui/material";
import { Link } from "react-router-dom";
import './Home.css'; // Import the CSS file

const Home = () => {

  const onProductsTextClick = useCallback(() => {
    console.log("Clicked on Products");
  }, []);

  const onAboutTextClick = useCallback(() => {

  }, []);

  const onFrameButtonClick = useCallback(() => {

  }, []);

  const onBuyATicketClick = useCallback(() => {

  }, []);

  const onRectangle1Click = useCallback(() => {

  }, []);

  const onRectangle2Click = useCallback(() => {

  }, []);

  const onMoreEventsTextClick = useCallback(() => {
    console.log('More events');
  }, []);

  const onRectangle4Click = useCallback(() => {

  }, []);

  return (
    <div className="homepage-container"> {/* Add the class for the container */}
      <img
        className="background-image" 
        alt=""
        src="/hd-wallpaper--silhouette-of-people-inside-stage-human-person-crowd-concert-1@2x.png"
      />
      <div className="products-text">
        <Link to="/events">Products</Link>
      </div>
      <div className="about-text" onClick={onAboutTextClick}>
        <Link to="/about">About</Link>
      </div>
      <img
        className="vector-image"
        alt=""
        src="/vector.svg"
      />
      <div className="description">
        <span>
          <p>Are you ready to elevate your concert and </p>
          <p>event experiences? Introducing Grabzzz, your</p>
          <p>one-stop destination for hassle-free ticket booking.</p>
          <p>Whether you are a music enthusiast, a sports </p>
          <p>fanatic, or an art lover, Grabzzz offers a seamless</p>
          <p>platform to discover and secure tickets for the</p>
          <p>hottest events in town.</p>
        </span>
      </div>

      {/* <Button
        className="frame-button"
        color="primary"
        variant="contained"
        onClick={onFrameButtonClick}
      >
        <Link to="/events">Buy a ticket</Link>
      </Button> */}

      <i className="featured-events-text">
        Featured events
      </i>
      <img
        className="featured-event-image1"
        alt=""
        src="/screenshot-from-20230928-165817-1@2x.png"
      />
      <img
        className="featured-event-image2"
        alt=""
        src="/screenshot-from-20230928-165951-1@2x.png"
      />
      <img
        className="featured-event-image3"
        alt=""
        src="/screenshot-from-20230928-175226-1@2x.png"
      />
      <img
        className="featured-event-image4"
        alt=""
        src="/screenshot-from-20230928-172138-1@2x.png"
      />
      <div className="ticket-box1" />
      <div className="buy-ticket-text1" onClick={onBuyATicketClick}>
        Buy a ticket
      </div>
      <div className="ticket-box2" onClick={onRectangle1Click} />
      <div className="buy-ticket-text2">
        Buy a ticket
      </div>
      <div className="ticket-box3" onClick={onRectangle2Click} />
      <div className="buy-ticket-text3">
        Buy a ticket
      </div>
      <div className="event-category-box">
        <div className="event-category" />
      </div>
      <div className="more-events-text">
        <b onClick={onMoreEventsTextClick}>
          <Link to="/events">More Events...</Link>
        </b>
      </div>
      <div className="ticket-box4" onClick={onRectangle4Click} />
      <div className="buy-ticket-text4">
        Buy a ticket
      </div>
      <div className="logo-text">
        <span>
          <span>G</span>
          <b> RABZZZ</b>
        </span>
      </div>
    </div>
  );
};

export default Home;
